	// General request template
	// ##################################################################################
	sendRequest: function(url, data, success)
	{
		//console.log('sendRequest::', url, data, success);	
		$.ajax( {
			type : 'GET',
			dataType: 'jsonp',
			async : true,
			url : url,
			data: data,
			success: success
		});
	}
	
